import Item from "../components/Login/components/Item";
import React from "react";

const Prueba = () => {
  return (
    <div className="container">
      <Item text="RKDKDKD" />
      <Input
                attribute={{
                  name: "user",
                  inputType: "text",
                  ph: "Ingrese correo",
                }}
                handleChange={handleChange}
                param={errors.usernameError}
              />
    </div>
  );
};

export default Prueba;
